import React from "react";
import Card from "@material-ui/core/Card";
import CardContent from "@material-ui/core/CardContent";
import Typography from "@material-ui/core/Typography";
import CardMedia from "@material-ui/core/CardMedia";

export default class NetworkPriceCard extends React.Component {
  render = () => (
    <Card style={{ backgroundColor: "#ea80fc" }}>
      <CardContent>
        <Typography color="textSecondary" gutterBottom>
          <span style={{ fontWeight: "bold" }}>Average network price:</span>{" "}
        </Typography>
        <Typography
          style={{ textAlign: "center" }}
          variant="h2"
          fcolor="textSecondary"
        >
          dummy
        </Typography>
        <CardMedia
          style={{ height: 0, paddingTop: "56.25%" }}
          image="https://media.giphy.com/media/2wh8dIGFpOX6NpAkle/giphy.gif"
          title="Paella dish"
        />
      </CardContent>
    </Card>
  );
}
